import React from 'react'
import { TodoItem } from './TodoItem';

export function TodoList({arrayTodo}) {
  return (
    <ul>
        {
            arrayTodo.map( (elementoTodo) => (
                <TodoItem todo={elementoTodo} />
            ))}
    </ul>
  );
}
